from array import arrayfavorite_foods = ["Chilli", "Fish and Chips", "Potatoes"]list_copied = favorite_foods.copy()print(favorite_foods == list_copied)foods_as_set = set(favorite_foods)second_set = foods_as_set.copy()print(foods_as_set == second_set)tuple1 = ("Parrot", "is", "late")tuple2 = ("Parrot", "is", "late")print(tuple1 == tuple2)# An array of integers, and a copyarray1 = array('i', [1,2,3])array_copy = array('i', [1,2,3])print(array1 == array_copy)